import React from "react";
import Search from "./Search";
const Banner = () => {
  const searchInputClass =
    "searcher transition-opacity duration-300 flex-1 z-0 pointer-events-auto opacity-100";
  return (
    <>
      <div className="bg-brandColor">
        <div className="container sm:max-w-md md:max-w-4xl text-center relative">
          <h1 className="text-white text-3xl sm:text-4xl font-normal leading-tight mb-8 sm:mb-0">
            Free Google Slides and PowerPoint templates to boost your
            presentations
          </h1>
          <Search classes={searchInputClass} />
        </div>
      </div>
    </>
  );
};

export default Banner;
